    [],nt"revision_timestamp": "2015-09-26T23:16:28.801522",nt"name": "2005-mississippi-merged-lidar-data-2005-lidar-data-merged-with-2005-post-katrina-lidar-data-to-",nt"isopen":
    false,nt"url": null,nt"notes": "Pre- and post-hurricane Katrina LiDAR datasets
    of Hancock, Harrison, and Jackson Counties, MS, were merged into a seamless coverage
    by URS. The pre-Katrina LiDAR data was collected by EarthData International at a
    5-meter posting density during the period of February 25 to March 30, 2005. Woolpert
    and USACE collected the post-Katina LiDAR data. Woolpert acquired 1-meter posting
    density data of Coastal Mississippi between the dates of September 19 and October
    9, 2005. USACE collected 1-meter posting density LiDAR of the Mississippi barrier
    islands over the same time period. Each dataset was clipped at the approximate location
    of the debris line. Data south of the debris line was removed from the Mississippi
    LiDAR dataset. Data north of the debris line was removed from the post-Katrina LiDAR
    dataset. The post-Katrina LIDAR dataset was then imported into the seamless Mississippi
    LiDAR dataset creating a merged seamless coverage.",nt"license_title": null,nt"extras":
